<script type=""text/javascript"">

    var pageLayout = 1;
    var pageLength = 7;

    $(document).ready(function () {
        loadData();
    });

    function loadData() {

        $.ajax({
            url: '/Company/List',
            type: 'GET',
            contentType: 'application/json;charset=utf-8',
            dataType: 'JSON',
            success: function (result) {
                $.each(result, function (key, item) {
                    var company = item.companyName;
                    $.ajax({
                        url: '/FindJob/List',
                        type: 'GET',
                        contentType: 'application/json;charset=utf-8',
                        dataType: 'JSON',
                        success: function (result) {
                            
                            var idCompany = result.companyId;
                            var pageCount = Math.ceil(result.length / pageLength);
                            if (pageLayout < 1) {
     ");
